import React from 'react'

function Navbar() {
    const nav = [
        {
            "title":"Syndico",
            "link":""
        },
        {
            "title":"Module",
            "link":""
        },
        {
            "title":"Contact",
            "link":""
        },
    ]
    const lang = [
        {
            "title":"Francais",
            "sub":"Fr",
            "link":""
        },
        {
            "title":"Arabe",
            "sub":"Ar",
            "link":""
        },
        {
            "title":"English",
            "sub":"En",
            "link":""
        },
    ]
  return (
    <div>
        <div className='navbar'>
            <logo>
                <img src="/images/syndico.png" />
            </logo>
            <ul>
                {nav.map((item,key)=>(
                    <li key={key+1}> <h3> {item.title} </h3> </li>
                ))}
                <li> <i class="fa-solid fa-globe"></i> </li>
            </ul>
        </div>

        <div className='langs'>
            {lang.map((lang,key)=>(
                <li> {lang.sub} </li>
            ))}
        </div>
    </div>
  )
}

export default Navbar
